// client/src/pages/ScenarioConfigurator.js
import React, { useState } from 'react';
import { Line } from 'react-chartjs-2';
import 'chart.js/auto';

function ScenarioConfigurator() {
  const [formData, setFormData] = useState({
    protocol: 'TCP',
    latency: 50,
    bandwidth: 1000,
    errorRate: 1,
  });

  const [simulation, setSimulation] = useState(null);
  const [showChart, setShowChart] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSimulate = () => {
    // Generate random simulated values
    const results = Array.from({ length: 10 }, (_, i) => ({
      t: `t${i + 1}`,
      throughput: Math.max(200, Math.random() * formData.bandwidth),
      delay: Math.max(10, Math.random() * formData.latency * 2),
      packetLoss: Math.min(10, Math.random() * formData.errorRate * 2),
    }));

    setSimulation(results);
    setShowChart(true);
  };

  const labels = simulation?.map((s) => s.t) || [];

  const data = {
    labels,
    datasets: [
      {
        label: 'Throughput (kbps)',
        data: simulation?.map((s) => s.throughput),
        borderColor: '#28a745',
        fill: false,
        tension: 0.3,
      },
      {
        label: 'Delay (ms)',
        data: simulation?.map((s) => s.delay),
        borderColor: '#0078d4',
        fill: false,
        tension: 0.3,
      },
      {
        label: 'Packet Loss (%)',
        data: simulation?.map((s) => s.packetLoss),
        borderColor: '#dc3545',
        fill: false,
        tension: 0.3,
      },
    ],
  };

  return (
    <div className="container">
      <h1>‚öôÔ∏è Scenario Configurator</h1>
      <p>Create your own network test case with custom parameters and visualize simulated outcomes.</p>

      {!showChart ? (
        <div className="form-box">
          <h3>Define Scenario</h3>

          <div className="form-group">
            <label>Protocol</label>
            <select name="protocol" value={formData.protocol} onChange={handleChange}>
              <option value="TCP">TCP</option>
              <option value="UDP">UDP</option>
              <option value="ICMP">ICMP</option>
            </select>
          </div>

          <div className="form-group">
            <label>Latency (ms)</label>
            <input
              type="number"
              name="latency"
              value={formData.latency}
              onChange={handleChange}
            />
          </div>

          <div className="form-group">
            <label>Bandwidth (kbps)</label>
            <input
              type="number"
              name="bandwidth"
              value={formData.bandwidth}
              onChange={handleChange}
            />
          </div>

          <div className="form-group">
            <label>Error Rate (%)</label>
            <input
              type="number"
              name="errorRate"
              value={formData.errorRate}
              onChange={handleChange}
            />
          </div>

          <button onClick={handleSimulate}>Run Simulation</button>
        </div>
      ) : (
        <div className="chart">
          <h3>üìä Simulation Results for {formData.protocol} Protocol</h3>
          <Line data={data} />
          <button style={{ marginTop: '1.5rem' }} onClick={() => setShowChart(false)}>
            Configure New Scenario
          </button>
        </div>
      )}
    </div>
  );
}

export default ScenarioConfigurator;
